import logo from './logo.svg';
import './App.css';

class App extends React.Component {
	constructor(props) {
		super(props);
		this.state = [];
	}

	render() {
		return (
			<div className="App">
			{
				this.state.map(monster => {
					<div key={monster.id}>
						<h1>{monster.name}</h1>
					</div>
				})
			}
			</div>
		);
	}
}

export default App;
